export var getField = function (column) {
    return column.field || column.key;
};
export var getLastField = function (field) {
    return field.split('.').pop();
};
export var getLastFieldParents = function (field) {
    var fieldParents = field.split('.');
    fieldParents.pop();
    return fieldParents;
};
